                                map.add(polygon);
                            });
                        } else if (checkBoxSelected.children[0].innerText === "产业园区"){
                            poisCYYQAreas.forEach(function(obj){
                                var polygon = new AMap.Polygon({
                                    path: obj.path,
                                    fillColor: '', // 多边形填充颜色
                                    borderWeight: 2, // 线条宽度，默认为 1
                                    strokeColor: 'red', // 线条颜色
                                });
                                map.add(polygon);
                            });
                        }
                    });
                }
            } else {
                map.clearMap();
            }
        });
        checkboxes.slice(0,1).forEach(function (checkbox) {
            checkbox.addEventListener('click', function (e) {
                var stateChecked = checkbox.classList.contains('layui-form-checked');
                if (stateChecked === true) {
                    checkbox.classList.add('selected');
                } else {
                    checkbox.classList.remove('selected');
                }
                var checkBoxesSelected = document.getElementsByClassName('selected');
                if (checkBoxesSelected.length === 0) {
                    buildingLayer.setStyle({
                        hideWithoutStyle: false,//是否隐藏设定区域外的楼块
                        areas: []
                    });
                } else {
                    var areas = [];
                    Array.from(checkBoxesSelected).forEach(function (checkBoxSelected) {
                        if (checkBoxSelected.children[0].innerText === "医院") {
                            poisHospitalAreas.forEach(function (obj) {
                                areas.push(obj);
                            });
                        } else if (checkBoxSelected.children[0].innerText === "学校") {
                            poisSchoolAreas.forEach(function (obj) {
                                areas.push(obj);
                            });
                        } else if (checkBoxSelected.children[0].innerText === "商店") {
                            poisShopAreas.forEach(function (obj) {
                                areas.push(obj);
                            });
                        } else if (checkBoxSelected.children[0].innerText === "小区") {
                            poisHousingAreas.forEach(function (obj) {
                                areas.push(obj);
                            });
                        } else if (checkBoxSelected.children[0].innerText === "体育") {
                            poisSportAreas.forEach(function (obj) {
                                areas.push(obj);
                            });
                        } else if (checkBoxSelected.children[0].innerText === "别墅") {
                            poisBieShuAreas.forEach(function (obj) {
                                areas.push(obj);
                            });
                        } else if (checkBoxSelected.children[0].innerText === "商务写字楼") {
                            poisSWXZLAreas.forEach(function (obj) {
                                areas.push(obj);
                            });
                        } else if (checkBoxSelected.children[0].innerText === "商住两用楼宇") {
                            poisSZLYLYAreas.forEach(function (obj) {
                                areas.push(obj);
                            });
                        } else if (checkBoxSelected.children[0].innerText === "风景名胜") {
                            poisFJMSAreas.forEach(function (obj) {
                                areas.push(obj);
                            });
                        } else if (checkBoxSelected.children[0].innerText === "交通设施") {
                            poisJTAreas.forEach(function (obj) {
                                areas.push(obj);
                            });
                        } else if (checkBoxSelected.children[0].innerText === "住宿服务") {
                            poisZSFWAreas.forEach(function (obj) {
                                areas.push(obj);
                            });
                        } else if (checkBoxSelected.children[0].innerText === "产业园区") {
                            poisCYYQAreas.forEach(function (obj) {
                                areas.push(obj);
                            });
                        }
                    });


                    var options =
                        {
                            hideWithoutStyle: false,//是否隐藏设定区域外的楼块
                            areas: areas
                        };
                    buildingLayer.setStyle(options); //此配色优先级高于自定义mapStyle
                }
            });
        });


    }
    setTimeout(checkBoxes,5000);
</script>
</body>
</html>
